import React from 'react';
import Todo from './todo';
const todolist = ({ Submitdata }) => {
	return (
		<>
			<div className="todo_list">
				{Submitdata.map(Submitdata => (
					<Todo key={Submitdata.id} Submitdata={Submitdata} />
				))}
			</div>
		</>
	);
};

export default todolist;
